import React, { useEffect, useState } from "react";
import { Row, Col, Container, Card, Button } from "react-bootstrap";

const Confirm = (props) => {

    const handleClick = () => {
        props.func(4);
    }

    return (
        <Col md = {3} className="mb-4">
        <Card className = "h-100">
            <Card.Body >
                <Card.Title>{sessionStorage.getItem("serviceName")}</Card.Title>
                <Card.Text> Доктор: {sessionStorage.getItem("doctorName")}</Card.Text>
                <Card.Text> Стоимость: {sessionStorage.getItem("servicePrice")}</Card.Text>
                <Card.Text> Дата: {new Date(+sessionStorage.getItem("date")).getTimezoneOffset()}</Card.Text>
                <Button variant="primary" onClick={() => handleClick()}>Записаться</Button>
            </Card.Body>
        </Card>
        </Col>
    )

}

export default Confirm;
